import React from "react";

const Todo = props => {
  return (
    <div>
      <ul>
        {props.todo.map(item => {
          return (
            <li key={item.id}>
              Title : {item.title} Status: {item.Completed}
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Todo;
